import styled from 'styled-components';
export const PolicyItems = styled.div`
  display: flex;
  .info {
    width: 80%;
    display: flex;
    flex-wrap: wrap;
    &:before {
      content: '${props => props.icon}';
      font-family: Fontawesome;
    }
  }
`
